import React from 'react';
import ReactDOM from 'react-dom';

import Cards from "./Cards";
import './index.css';
import Sdata from './Sdata';

import Netflix from './Netflix';
import Amazon from './Amazon';

const netseries = 'Netflix';

function Net(){
  if (netseries === 'Netflix'){
  }else{
    return (
      <Cards 
      key = {Sdata[4].id}
      crdimg = {Sdata[4].simgsrc}
      title= {Sdata[4].stitle}
      category= {Sdata[4].scategory} 
      link= {Sdata[4].slink} 
    />
    )
  }
}


function App(){
    return (
        <React.Fragment>        
        <h1 className='heading_style'>The Top 5 Netflix Weberies</h1>
        {Net()}
      </React.Fragment>
    )
}

export default App;
